import React from 'react';
import { fade, makeStyles } from '@material-ui/core/styles';
import {AppBar,Toolbar,IconButton,Typography,InputBase,Badge,ButtonBase,FormControl,NativeSelect,Box,Divider} from '@material-ui/core';
import ban1 from '../image/ban1.jpg';


const useStyles = makeStyles((theme) => ({
  grow: {
    flexGrow: 1,
  },
  ban1: {
      width: "100%"
  }
}));

export default function Home() {
  const classes = useStyles();
  
  return (
      <React.Fragment>
    <div className={classes.grow}>
    <img src={ban1} alt="My logo"  />
    </div>
    </React.Fragment>
  );
}
